LOADING.GetHintGameTypes = function ( f4_arg0 )
	local f4_local0 = Dvar.DHEEJCCJBH( "MOLPOSLOMO" )
	local f4_local1 = Dvar.DHEEJCCJBH( "MTQQTNNTMM" ) or ""
	local f4_local2 = Dvar.DHEEJCCJBH( "scr_br_gametype" )
	local f4_local3 = Dvar.DHEEJCCJBH( "NSQLTTMRMP" )
	if CONDITIONS.IsWZPayload() then
		if Engine.DDJFBBJAIG() then
			f4_local0 = {
				nil,
				"payload_attackers",
				"payload_defenders"
			}
		else
			local f4_local4 = Game.DHEDEIHGF()
			local f4_local5 = DataSources.inGame.MP.match.currentRound and DataSources.inGame.MP.match.currentRound:GetValue( f4_arg0 ) or 0
			if not (f4_local5 ~= 0 or f4_local4 ~= Teams.axis) or f4_local5 == 1 and f4_local4 == Teams.allies then
				f4_local0 = "payload_attackers"
			else
				f4_local0 = "payload_defenders"
			end
		end
	elseif CONDITIONS.IsBRRevealMode() then
		f4_local0 = "reveal"
	elseif CONDITIONS.IsBRX2Gametype() then
		f4_local0 = "x2"
	elseif CONDITIONS.IsBRLEPGametype() then
		f4_local0 = "lep"
	elseif CONDITIONS.IsBRExfiltrationMode() then
		f4_local0 = "exfiltration"
	elseif CONDITIONS.IsRebirthSoloGametype() then
		f4_local0 = "rebirthsolo"
		if CONDITIONS.IsMapDragonsDen() then
			f4_local0 = "ddresurgenceSolo"
		end
	elseif CONDITIONS.IsWZRatRace() then
		f4_local0 = "ratrace"
	elseif CONDITIONS.IsBRHalloweenPublicMatch() and f4_local2 ~= "zxp" then
		f4_local0 = "seasonalEvent"
